Â <template>
  <div style="width:100%;height:100%;">
    <script src="//dn-ali-js-cdn.qbox.me/jquery/1.9.1/jquery.min.js" type="text/javascript" />
    <iframe
      src="https://bing.com"
      id="iframeId"
      frameborder="0"
      scrolling="yes"
      width="100%"
      height="auto"
      style="width:100%;height:720px;"
    ></iframe>
  </div>
</template>

<script>
import { getAction } from '@/api/manage'
export default {
  data() {
    return {
      msg: ''
    }
  },
  methods: {
    hello() {
      var url = '/demo/info/hello'
      getAction(url).then(res => {
        if (res.success) {
          this.msg = res.result
        }
      })
    }
  },
  created() {
    this.hello()
    iframeHeight()
  }
}

function iframeHeight() {
  document.getElementById('iframeId').height = '100%'
  console.log($(window).height())
}
</script>
